webpackJsonp([0xb9dc86290863],{411:function(A,e){A.exports={data:{site:{siteMetadata:{title:"max-bittker"}},markdownRemark:{id:"/home/maxbittker/repos/MaxBittker.github.io/src/pages/rc-art-pop-up/index.md absPath of file >>> MarkdownRemark",html:'<blockquote>\n<p>“There are many side-effects that the artist cannot imagine. These may be used as ideas for new works.” - Sol Lewitt, 1969</p>\n</blockquote>\n<p>I’m in Berlin for the first time in my life! Compared to North America, the pigeons look the same, but the crows look different. It’s cold and wet and the streets are beautiful and crammed with masonry, signage, posters and tags.</p>\n<p>There are lots of hip-looking parents biking their bundled up tots around the neighborhood. An industrial noise show featuring two hunched figures grunting into WW1 gas masks took place in the bar below the workspace last night.</p>\n<div>\n    \n  <a class="gatsby-resp-image-link" href="/static/IMG_1161-4012e577068e8f8abd92cdf169152418-53bcb.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Berlin Streets" title="" src="/static/IMG_1161-4012e577068e8f8abd92cdf169152418-f8fb9.jpg" srcset="/static/IMG_1161-4012e577068e8f8abd92cdf169152418-e8976.jpg 148w,\n/static/IMG_1161-4012e577068e8f8abd92cdf169152418-63df2.jpg 295w,\n/static/IMG_1161-4012e577068e8f8abd92cdf169152418-f8fb9.jpg 590w,\n/static/IMG_1161-4012e577068e8f8abd92cdf169152418-85e3d.jpg 885w,\n/static/IMG_1161-4012e577068e8f8abd92cdf169152418-d1924.jpg 1180w,\n/static/IMG_1161-4012e577068e8f8abd92cdf169152418-9452e.jpg 1770w,\n/static/IMG_1161-4012e577068e8f8abd92cdf169152418-53bcb.jpg 2448w" sizes="(max-width: 590px) 100vw, 590px">\n    </span>\n  </span>\n  \n  </a>\n    \n    \n  <a class="gatsby-resp-image-link" href="/static/IMG_1163-7a9aad071ae69824ca9f143c6a41e511-53bcb.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Berlin Streets" title="" src="/static/IMG_1163-7a9aad071ae69824ca9f143c6a41e511-f8fb9.jpg" srcset="/static/IMG_1163-7a9aad071ae69824ca9f143c6a41e511-e8976.jpg 148w,\n/static/IMG_1163-7a9aad071ae69824ca9f143c6a41e511-63df2.jpg 295w,\n/static/IMG_1163-7a9aad071ae69824ca9f143c6a41e511-f8fb9.jpg 590w,\n/static/IMG_1163-7a9aad071ae69824ca9f143c6a41e511-85e3d.jpg 885w,\n/static/IMG_1163-7a9aad071ae69824ca9f143c6a41e511-d1924.jpg 1180w,\n/static/IMG_1163-7a9aad071ae69824ca9f143c6a41e511-9452e.jpg 1770w,\n/static/IMG_1163-7a9aad071ae69824ca9f143c6a41e511-53bcb.jpg 2448w" sizes="(max-width: 590px) 100vw, 590px">\n    </span>\n  </span>\n  \n  </a>\n    \n    \n  <a class="gatsby-resp-image-link" href="/static/IMG_1165-c9a0abe385fccf7dcadbbc9202a360b7-53bcb.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Berlin Streets" title="" src="/static/IMG_1165-c9a0abe385fccf7dcadbbc9202a360b7-f8fb9.jpg" srcset="/static/IMG_1165-c9a0abe385fccf7dcadbbc9202a360b7-e8976.jpg 148w,\n/static/IMG_1165-c9a0abe385fccf7dcadbbc9202a360b7-63df2.jpg 295w,\n/static/IMG_1165-c9a0abe385fccf7dcadbbc9202a360b7-f8fb9.jpg 590w,\n/static/IMG_1165-c9a0abe385fccf7dcadbbc9202a360b7-85e3d.jpg 885w,\n/static/IMG_1165-c9a0abe385fccf7dcadbbc9202a360b7-d1924.jpg 1180w,\n/static/IMG_1165-c9a0abe385fccf7dcadbbc9202a360b7-9452e.jpg 1770w,\n/static/IMG_1165-c9a0abe385fccf7dcadbbc9202a360b7-53bcb.jpg 2448w" sizes="(max-width: 590px) 100vw, 590px">\n    </span>\n  </span>\n  \n  </a>\n    \n</div>\n<p>Along with widening my narrow world experience and trying out my high-school german (es ist schlecht), I’m here to hang out with some Recurse Center alumnus in a cozy studio for a week and make computer art! It’s a wonderful opportunity and I’m thankful + excited to learn from people here and devote time to making confusing, useless, and (hopefully) beautiful but at least entertaining things.</p>\n<div>\n    \n  <a class="gatsby-resp-image-link" href="/static/IMG_1155-8e70556f0e48131c4e889d51f3608982-53bcb.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Berlin Streets" title="" src="/static/IMG_1155-8e70556f0e48131c4e889d51f3608982-f8fb9.jpg" srcset="/static/IMG_1155-8e70556f0e48131c4e889d51f3608982-e8976.jpg 148w,\n/static/IMG_1155-8e70556f0e48131c4e889d51f3608982-63df2.jpg 295w,\n/static/IMG_1155-8e70556f0e48131c4e889d51f3608982-f8fb9.jpg 590w,\n/static/IMG_1155-8e70556f0e48131c4e889d51f3608982-85e3d.jpg 885w,\n/static/IMG_1155-8e70556f0e48131c4e889d51f3608982-d1924.jpg 1180w,\n/static/IMG_1155-8e70556f0e48131c4e889d51f3608982-9452e.jpg 1770w,\n/static/IMG_1155-8e70556f0e48131c4e889d51f3608982-53bcb.jpg 2448w" sizes="(max-width: 590px) 100vw, 590px">\n    </span>\n  </span>\n  \n  </a>\n    \n    \n  <a class="gatsby-resp-image-link" href="/static/IMG_1156-4ee8dc95b597bf18d5d46bed073c49de-53bcb.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Berlin Streets" title="" src="/static/IMG_1156-4ee8dc95b597bf18d5d46bed073c49de-f8fb9.jpg" srcset="/static/IMG_1156-4ee8dc95b597bf18d5d46bed073c49de-e8976.jpg 148w,\n/static/IMG_1156-4ee8dc95b597bf18d5d46bed073c49de-63df2.jpg 295w,\n/static/IMG_1156-4ee8dc95b597bf18d5d46bed073c49de-f8fb9.jpg 590w,\n/static/IMG_1156-4ee8dc95b597bf18d5d46bed073c49de-85e3d.jpg 885w,\n/static/IMG_1156-4ee8dc95b597bf18d5d46bed073c49de-d1924.jpg 1180w,\n/static/IMG_1156-4ee8dc95b597bf18d5d46bed073c49de-9452e.jpg 1770w,\n/static/IMG_1156-4ee8dc95b597bf18d5d46bed073c49de-53bcb.jpg 2448w" sizes="(max-width: 590px) 100vw, 590px">\n    </span>\n  </span>\n  \n  </a>\n    \n    \n  <a class="gatsby-resp-image-link" href="/static/IMG_1158-0ecffffd4e9dfafc66bff14bfd802a13-53bcb.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Berlin Streets" title="" src="/static/IMG_1158-0ecffffd4e9dfafc66bff14bfd802a13-f8fb9.jpg" srcset="/static/IMG_1158-0ecffffd4e9dfafc66bff14bfd802a13-e8976.jpg 148w,\n/static/IMG_1158-0ecffffd4e9dfafc66bff14bfd802a13-63df2.jpg 295w,\n/static/IMG_1158-0ecffffd4e9dfafc66bff14bfd802a13-f8fb9.jpg 590w,\n/static/IMG_1158-0ecffffd4e9dfafc66bff14bfd802a13-85e3d.jpg 885w,\n/static/IMG_1158-0ecffffd4e9dfafc66bff14bfd802a13-d1924.jpg 1180w,\n/static/IMG_1158-0ecffffd4e9dfafc66bff14bfd802a13-9452e.jpg 1770w,\n/static/IMG_1158-0ecffffd4e9dfafc66bff14bfd802a13-53bcb.jpg 2448w" sizes="(max-width: 590px) 100vw, 590px">\n    </span>\n  </span>\n  \n  </a>\n    \n</div>\n<p>Because of the limited time I have here, I’m going to try to stick to tools that I’m familiar with and yaks I’ve already shaved, so this means webgl, regl, clojure and svg. These tools have their own interesting limitations, but I’m feeling inspired by those more than constrained. Fragment shaders are very terse and may be the tool with the richest or densest possibility space I’ve ever used, by which I mean mistakes and bugs really frequently turn out interesting and fruitful. Cool unexpected emergent behavior / bugs may be one of my favorite parts of making art with computers. Life existing on earth is a cool bug.</p>\n<p>Documenting my process and sharing art and code are another goal I have while I’m here, inspired by <a href="http://piratefsh.github.io/2017/12/03/rc-computer-art-pop-up-weekend-reflections.html">Sher Minn’s blogging</a>. Look out for more posts and some things you can play with!</p>\n<p>One last note is that short feedback loops are awesome, more than just efficiency, they change how you work. People talk about this a lot with regards to live building/reloading tools like figwheel and webpack, but I’ve been trying to extend it to my source control and design-space exploration using <a href="https://github.com/maxbittker/gitsnaps">a custom script</a>\nto</p>\n<ol>\n<li>Take snapshots of directory state + code output, and store them as git commits</li>\n<li>Build galleries of these checkpoints + commit SHA1s</li>\n</ol>\n<p>This makes it fast and low friction to explore ideas, delete code, and return to previous ideas. I’d love to take the tool a step further to output a gallery of live examples instead of static images, but I’ll consider this week to be UX testing of it’s current capabilities and my needs. Here’s some example output for my <a href="https://github.com/maxbittker/regl-experiments">webgl experiment repo</a>, I expect to see this list grow over the course of the week!</p>\n<div style="display:inline-block; margin:auto; width:100%">\n\n  <a class="gatsby-resp-image-link" href="/static/gview-example-cf496930837b458894ed0a7b354cd11c-36d7a.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 300.4854368932039%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="gsnap gallery view example" title="" src="/static/gview-example-cf496930837b458894ed0a7b354cd11c-fb8a0.png" srcset="/static/gview-example-cf496930837b458894ed0a7b354cd11c-1a291.png 148w,\n/static/gview-example-cf496930837b458894ed0a7b354cd11c-2bc4a.png 295w,\n/static/gview-example-cf496930837b458894ed0a7b354cd11c-fb8a0.png 590w,\n/static/gview-example-cf496930837b458894ed0a7b354cd11c-526de.png 885w,\n/static/gview-example-cf496930837b458894ed0a7b354cd11c-fa2eb.png 1180w,\n/static/gview-example-cf496930837b458894ed0a7b354cd11c-08f6a.png 1770w,\n/static/gview-example-cf496930837b458894ed0a7b354cd11c-36d7a.png 2060w" sizes="(max-width: 590px) 100vw, 590px">\n    </span>\n  </span>\n  \n  </a>\n    \n</div>',frontmatter:{title:"Recurse Center Berlin Pop-up",date:"December 04, 2017"}}},pathContext:{slug:"/rc-art-pop-up/",previous:{fields:{slug:"/user-styles/"},frontmatter:{title:"Make Yourself Comfortable with Custom Styling"}},next:{fields:{slug:"/rc-art-pop-up-webcams/"},frontmatter:{title:"RC Pop-up Day 1 - Webcam Feedback"}}}}}});
